package com.todoList.demo.security;public class JwtAuthResponse {    private String token;    private String userName;    private String id;    private String roles;    private String email;    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getRoles() {        return roles;    }    public void setRoles(String roles) {        this.roles = roles;    }    public String getUserName() {        return userName;    }    public void setUserName(String userName) {        this.userName = userName;    }    public String getToken() {        return token;    }    public void setToken(String token) {        this.token = token;    }    public JwtAuthResponse() {        super();    }}